export class List{static remove(t,e){const n=t.indexOf(e);return-1!==n&&(t.splice(n,1),!0)}static retainMax(t,e){t.length>e&&t.splice(0,t.length-e)}static removeIf(t,e){for(let n=t.length-1;n>=0;n--)if(e(t[n]))return t.splice(n,1),!0;console.log("no element removed from list")}static removeOneOrThrowException(t,e){if(!this.removeIf(t,e))throw new Error("no element removed from list")}static empty(t){return null==t||0==t.length}static notEmpty(t){return!this.empty(t)}static lastIndex(t,e){return e===t.length-1}static validIndex(t,e){return e>=0&&e<t.length}static includes(t,e){return t.includes(e)}static contains(t,e){return t.includes(e)}static addIfNotPresent(t,e){t.includes(e)||t.push(e)}static assertNoNullElements(t){for(const e of t)if(null==e)throw new Error("null passed into list")}}